import React, { Component } from 'react';

class TimeWrap extends Component {
  render() {
    const { hour, min, sec, milliSec } = this.props
    return (
      <div className="time-wrap" id='time_wrap'>
        <span id="hour">
          {
            this.state.hour < 10 ?
            '0' + this.state.hour : this.state.hour
          } 
        </span>
        : 
        <span id="min">
          {
            this.state.min < 10 ?
            '0' + this.state.min : this.state.min
          } 
        </span> 
        :
        <span id="sec">
          {
            this.state.sec < 10 ?
            '0' + this.state.sec : this.state.sec
          } 
        </span>
        : 
        <span id="milliSec">
          {
            this.state.milliSec < 10 ?
            '0' + this.state.milliSec : this.state.milliSec
          }
        </span>
      </div>
    )
  }
}

export default TimeWrap;
